window.onload=()=>{(async()=>{const e=await fetch("/getRoom",{method:"GET",headers:{"Content-Type":"application/json"}}),n=await e.json(),o=n.rooms,r=o[o.length-1];if(console.log("Room Data: "+JSON.stringify(r)),!n)return;const a=document.querySelector("#roomName"),t=document.querySelector("#roomTheme"),i=document.querySelector("#roomMembers");switch(a.innerHTML=`Name: ${r.name}`,t.innerHTML="Theme: ",r.theme){case"default":t.innerHTML+="Default";break;case"coffee":t.innerHTML+="Coffee";break;case"western":t.innerHTML+="Western";break;case"cyberpunk":t.innerHTML+="Cyberpunk";break;case"kawaii":t.innerHTML+="Kawaii";break;default:t.innerHTML+="Undefined"}i.innerHTML=`Amount of Members: ${r.amtMembers}`})()};